import React from 'react';

function AboutMe() {
  return (
    <div className="about-me">
      <h1>About Me</h1>
      <p>Hello! I am [Your Name], a web developer with experience in React, JavaScript, and UI/UX design.</p>
      <h2>Experience</h2>
      <ul>
        <li>Web Developer at Company A - 2020 to Present</li>
        <li>Frontend Developer at Company B - 2018 to 2020</li>
        <li>Intern at Startup C - 2017 to 2018</li>
      </ul>
    </div>
  );
}

export default AboutMe;
